{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/amirmotefaker/movie-recommendation-system-using-r-best?scriptVersionId=120254649\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"1f32423d","metadata":{"_execution_state":"idle","_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","papermill":{"duration":0.038249,"end_time":"2023-02-25T07:26:45.557854","exception":false,"start_time":"2023-02-25T07:26:45.519605","status":"completed"},"tags":[]},"source":["# What is Movie Recommendation?\n","- A movie recommendation system, or a movie recommender system, is an ML-based approach to filtering or predicting the users’ film preferences based on their past choices and behavior. It’s an advanced filtration mechanism that predicts the possible movie choices of the concerned user and their preferences towards a domain-specific item, aka movie.\n","\n","# Filtration Strategies for Movie Recommendation Systems\n","- The most popular categories of the ML algorithms used for movie recommendations include content-based filtering and collaborative filtering systems.\n","    - Content-Based Filtering\n","    - Collaborative Filtering\n","        - Collaborative filtering algorithms are divided into two categories:\n","\n","            - User-based collaborative filtering. The idea is to look for similar patterns in movie preferences in the target user and other users in the database.\n","            - Item-based collaborative filtering. The basic concept here is to look for similar items (movies) that target users rate or interact with.\n","\n","\n","# How to Build a Movie Recommendation System?\n","- The basics of film recommendation engines are in machine learning, we could on to building an actual movie recommendation system.\n","    1. Data\n","        - ML systems need data, so find and import the essential libraries with movie datasets that already have global ratings.\n","    2. Analysis \n","        - Create generic recommendations of top-rated movies from the existing dataset.\n","    3. Personalization \n","        - Get personalized ratings by providing your own movie scores.\n","    4. Strategy \n","        - Implement a content-based or collaborative filtering strategy.\n","    5. Combination \n","        - Combine recommendation lists to get a reasonable estimate across the ratings. The combined dataset of movie ratings can now be used for either filtering model.\n","        \n","# Best Movie Datasets for Recommendation Systems in ML\n","- [MovieLens 25M data set](https://grouplens.org/datasets/movielens/)\n","- [IMDB Datasets](https://www.imdb.com/interfaces/)\n","- [Linguistic Data of 32k Film Subtitles with IMBDb Meta-Data](https://data.world/robertjoellewis/film-subtitles)\n","- [Film data set from UCI](https://archive.ics.uci.edu/ml/datasets/Movie)\n","- [Full MovieLens dataset on Kaggle](https://www.kaggle.com/rounakbanik/the-movies-dataset)\n","- [Cornell Film Review Data](http://www.cs.cornell.edu/people/pabo/movie-review-data/)\n","- [French National Cinema Center datasets](https://www.data.gouv.fr/fr/organizations/centre-national-du-cinema-et-de-l-image-animee/)\n","- [Movie Industry on Kaggle](https://www.kaggle.com/danielgrijalvas/movies)\n","- [Movie Body Counts](http://moviebodycounts.com/)\n","- [Movie datasets on data.world](https://data.world/datasets/movies)\n","\n","# Top Movie Recommendation System Use Cases\n","- [Netflix](https://www.netflix.com/)\n","- [Amazon](https://www.primevideo.com/)\n","- [YouTube](https://www.youtube.com/)\n","\n","##### Reference: [LabelYourData](https://labelyourdata.com/articles/movie-recommendation-with-machine-learning#introduction_to_the_movie_recommendation_system_architecture)\n","\n","# Important points of Movie Recommendation\n","\n","- Recommendation systems play an important role in e-commerce and online streaming services, such as Netflix, YouTube, and Amazon. Making the right recommendation for the next product, music or movie increases user retention and satisfaction, leading to sales and profit growth. Companies competing for customer loyalty invest in systems that capture and analyze the user’s preferences and offer products or services with a higher likelihood of purchase.\n","\n","- The economic impact of such a company-customer relationship is clear: Amazon is the largest online retail company by sales and part of its success comes from the recommendation system and marketing based on user preferences. In 2006 Netflix offered a one million dollar prize2 for the person or group that could improve their recommendation system by at least 10%.\n","\n","- Usually, recommendation systems are based on a rating scale from 1 to 5 grades or stars, with 1 indicating the lowest satisfaction and 5 being the highest satisfaction. Other indicators can also be used, such as comments posted on previously used items; video, music, or link shared with friends; percentage of movies watched or music listened; web pages visited and time spent on each page; product category; and any other interaction with the company’s web site or application can be used as a predictor.\n","\n","- The primary goal of recommendation systems is to help users find what they want based on their preferences and previous interactions and predict the rating for a new item. In this document, we create a movie recommendation system using the MovieLens dataset and apply the lessons learned during Harvard’s Data Science Professional Certificate3 program.\n","\n","- This document is structured as follows. Chapter 1 describes the dataset and summarizes the goal of the project and the key steps that were performed. In chapter 2 we explain the process and techniques used, such as data cleaning, data exploration, and visualization, any insights gained, and the modeling approach. In chapter 3 we present the modeling results and discuss the model performance. We conclude in chapter 4 with a brief summary of the report, its limitations, and future work.\n","\n","# MovieLens Dataset\n","- GroupLens is a research lab at the [University of Minnesota](https://twin-cities.umn.edu/) that has collected and made available rating data for movies on the [MovieLens website](https://grouplens.org/datasets/movielens/).\n","\n","- The complete MovieLens dataset consists of 27 million ratings of 58,000 movies by 280,000 users. The research presented in this paper is based on a subset of this dataset with 10 million ratings on 10,000 movies by 72,000 users.\n","\n","# Most common loss functions in ML\n","\n","- Mean Absolute Error/L1 Loss (MAE)\n","    - Mean absolute error, is measured as the average of the sum of absolute differences between predictions and actual observations. Like MSE, this as well measures the magnitude of error without considering their direction. Unlike MSE, MAE needs more complicated tools such as linear programming to compute the gradients. Plus MAE is more robust to outliers since it does not make use of squares.\n","    \n","    \n","- Mean Square Error/Quadratic Loss/L2 Loss (MSE)\n","    - Mean square error is measured as the average squared difference between predictions and actual observations. It’s only concerned with the average magnitude of error irrespective of their direction. However, due to squaring, predictions that are far away from actual values are penalized heavily in comparison to less deviated predictions. Plus MSE has nice mathematical properties which make it easier to calculate gradients.\n","    \n","    \n","- Root Mean Square Error (RMSE)\n","    - Root mean square error or root mean square deviation is one of the most commonly used measures for evaluating the quality of predictions. It shows how far predictions fall from measured true values using Euclidean distance.\n","    - To compute RMSE, calculate the residual (difference between prediction and truth) for each data point, compute the norm of residual for each data point, compute the mean of residuals, and take the square root of that mean. RMSE is commonly used in supervised learning applications, as RMSE uses and needs true measurements at each predicted data point."]},{"cell_type":"markdown","id":"1030b190","metadata":{"papermill":{"duration":0.033845,"end_time":"2023-02-25T07:26:45.627116","exception":false,"start_time":"2023-02-25T07:26:45.593271","status":"completed"},"tags":[]},"source":["# Data Preparation"]},{"cell_type":"markdown","id":"d9bd9c42","metadata":{"papermill":{"duration":0.032848,"end_time":"2023-02-25T07:26:45.692001","exception":false,"start_time":"2023-02-25T07:26:45.659153","status":"completed"},"tags":[]},"source":["## Install Libraries"]},{"cell_type":"code","execution_count":1,"id":"b6626e23","metadata":{"execution":{"iopub.execute_input":"2023-02-25T07:26:45.761346Z","iopub.status.busy":"2023-02-25T07:26:45.758991Z","iopub.status.idle":"2023-02-25T07:26:50.295948Z","shell.execute_reply":"2023-02-25T07:26:50.293768Z"},"papermill":{"duration":4.575211,"end_time":"2023-02-25T07:26:50.299968","exception":false,"start_time":"2023-02-25T07:26:45.724757","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Loading required package: ggplot2\n","\n","Loading required package: lattice\n","\n","\n","Attaching package: ‘caret’\n","\n","\n","The following object is masked from ‘package:httr’:\n","\n","    progress\n","\n","\n","\n","Attaching package: ‘dplyr’\n","\n","\n","The following objects are masked from ‘package:data.table’:\n","\n","    between, first, last\n","\n","\n","The following objects are masked from ‘package:stats’:\n","\n","    filter, lag\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    intersect, setdiff, setequal, union\n","\n","\n","\n","Attaching package: ‘ggthemes’\n","\n","\n","The following object is masked from ‘package:cowplot’:\n","\n","    theme_map\n","\n","\n","Loading required package: timechange\n","\n","\n","Attaching package: ‘lubridate’\n","\n","\n","The following objects are masked from ‘package:data.table’:\n","\n","    hour, isoweek, mday, minute, month, quarter, second, wday, week,\n","    yday, year\n","\n","\n","The following object is masked from ‘package:cowplot’:\n","\n","    stamp\n","\n","\n","The following objects are masked from ‘package:base’:\n","\n","    date, intersect, setdiff, union\n","\n","\n","\n","Attaching package: ‘Metrics’\n","\n","\n","The following objects are masked from ‘package:caret’:\n","\n","    precision, recall\n","\n","\n"]}],"source":["# if(!require(tidyverse)) \n","#   install.packages(\"tidyverse\", repos = \"http://cran.us.r-project.org\")\n","# if(!require(caret)) \n","#   install.packages(\"caret\", repos = \"http://cran.us.r-project.org\")\n","# if(!require(data.table)) \n","#   install.packages(\"data.table\", repos = \"http://cran.us.r-project.org\")\n","\n","# Loading the required libraries\n","library(caret)\n","library(cowplot)\n","library(data.table)\n","library(dplyr)\n","library(ggplot2)\n","library(ggthemes)\n","library(lubridate)\n","library(Metrics)\n","library(recosystem)\n","library(scales)\n","library(stringr)\n","library(tibble)\n","library(tidyr)"]},{"cell_type":"markdown","id":"c533acea","metadata":{"papermill":{"duration":0.036257,"end_time":"2023-02-25T07:26:50.370041","exception":false,"start_time":"2023-02-25T07:26:50.333784","status":"completed"},"tags":[]},"source":["- Brief description about these libraries:\n","    - [caret](https://www.rdocumentation.org/packages/caret/): this library’s name is short for “Classification And Regression Training”, being arguably the most popular R package for the matter. It contains a variety of tools to streamline machine learning tasks, and as such many of the functions used throughout this document are from within this package. \n","    \n","    - [cowplot](https://www.rdocumentation.org/packages/cowplot/): this library eases the construction of publication-quality figures.\n","    \n","    - [data.table](https://www.rdocumentation.org/packages/data.table/): a high-performance library to work, manipulate and operate with dataframes.\n","    \n","    - [dplyr](https://www.rdocumentation.org/packages/dplyr/): arguably the most popular R package for data manipulation. It provides a consistent set of tools for the matter, enabling data manipulation in an intuitive, user-friendly way. Data analysts typically use dplyr to transform existing datasets into a fitting format (dataframes are usually preferred) for data analysis, data exploration and data visualization tasks.\n","    \n","    - [ggplot2](https://www.rdocumentation.org/packages/ggplot2/): the most popular library for data visualization. It can greatly improve the quality and aesthetics of one’s graphics, being not only highly customizable but also remarkably efficient.\n","\n","    - [ggthemes](https://www.rdocumentation.org/packages/ggthemes/): ggplot2 and its official extension support allows developers to easily create their own tools and presets. ggthemes is built upon that support to provide additional themes for ggplot2’s graphics.\n","    \n","    - [lubridate](https://www.rdocumentation.org/packages/lubridate/): a library designed to simplify (and speed-up) time-related tasks and calculations.\n","\n","    - [Metrics](https://www.rdocumentation.org/packages/Metrics/): this library is built around evaluation metrics, providing functions to simplify their calculation. \n","    \n","    - [recosystem](https://www.rdocumentation.org/packages/recosystem/): this library is built around matrix factorization, bundling a collection of functions to simplify the process at hand.\n","    \n","    - [scales](https://www.rdocumentation.org/packages/scales/): this library was included to properly scale some plot’s axis to better visualize and understand the data being plotted.\n","    \n","    - [stringr](https://www.rdocumentation.org/packages/stringr/): this library a set of functions designed to make working with strings as easy as possible.\n","    \n","    - [tibble](https://www.rdocumentation.org/packages/tibble/): this library re-imagines the dataframe format, tidying it up leading to a cleaner solution.\n","     \n","    - [tidyr](https://www.rdocumentation.org/packages/tidyr/): this library simplifies the process of tidying data so that it can be easily evaluated/studied and standardizing it in format that most functions accept. "]},{"cell_type":"markdown","id":"c61eda65","metadata":{"papermill":{"duration":0.03997,"end_time":"2023-02-25T07:26:50.445022","exception":false,"start_time":"2023-02-25T07:26:50.405052","status":"completed"},"tags":[]},"source":["## Read Dataset"]},{"cell_type":"markdown","id":"109ca66c","metadata":{"papermill":{"duration":0.034896,"end_time":"2023-02-25T07:26:50.515913","exception":false,"start_time":"2023-02-25T07:26:50.481017","status":"completed"},"tags":[]},"source":["## The MovieLens dataset\n","- GroupLens Research has collected and made available rating data sets from the MovieLens web site (https://movielens.org). The data sets were collected over various periods of time, depending on the size of the set. Before using these data sets, please review their README files for the usage licenses and other details.\n","\n","- Dataset is provided by GroupLens (a research lab within the Univeristy of Minnesota) and holds 27 million ratings applied to 58,000 movies by 280,000 users. Once again, that might be too much to ask of most basic personal computers and would imply seriously long training times, so only a small subset of the whole dataset will be used given the sheer size of the latter (particularly, the exercise makes use of the [10M MovieLens subset](https://files.grouplens.org/datasets/movielens/ml-10m.zip)).\n","\n","## MovieLens 10M Dataset\n","- MovieLens 10M movie ratings. Stable benchmark dataset. 10 million ratings and 100,000 tag applications applied to 10,000 movies by 72,000 users. Released 1/2009.\n","\n","    - [README.txt](https://files.grouplens.org/datasets/movielens/ml-10m-README.html)\n","    - [ml-10m.zip](https://files.grouplens.org/datasets/movielens/ml-10m.zip) (size: 63 MB, [checksum](https://files.grouplens.org/datasets/movielens/ml-10m.zip.md5))\n","Permalink: https://grouplens.org/datasets/movielens/10m/\n","\n","\n","\n","- ratings.dat: a four column dataset containing:\n","\n","    - A user ID\n","    - A movie ID\n","    - The score with which said user rated the movie\n","    - A timestamp\n","    \n","    \n","- movies.dat: a three column dataset containing:\n","\n","    - A movie ID\n","    - The movie title\n","    - The movie genres\n","    \n","    \n","- tags.dat: a tag-related dataset that will not be used for this exercise."]},{"cell_type":"markdown","id":"9391d9a1","metadata":{"papermill":{"duration":0.038833,"end_time":"2023-02-25T07:26:50.641508","exception":false,"start_time":"2023-02-25T07:26:50.602675","status":"completed"},"tags":[]},"source":["## The ratings.dat is imported into the workspace\n","- These files are to be worked with individually, just as is showcased in the next code snippet. The data has to be read properly, and there are various functions to perform this loading process like fread(), from the data.table library, and str_split_fixed(), from the stringr library. Each function has its own particular syntax, so informing oneself regarding their behavior, arguments, and intricacies is recommended.\n","\n","- Both ratings.dat and movies.dat have their column data separated with a “::” string, which needs to be properly specified in each of these functions. The column names should also be defined to facilitate indexing-related functions.\n","\n","- Both fread() and str_split_fixed() are showcased in the following code snippet, the former with the ratings.dat dataset and the latter with movies.dat (beware the computing time)."]},{"cell_type":"code","execution_count":2,"id":"d43fede1","metadata":{"execution":{"iopub.execute_input":"2023-02-25T07:26:50.769991Z","iopub.status.busy":"2023-02-25T07:26:50.717111Z","iopub.status.idle":"2023-02-25T07:29:38.015676Z","shell.execute_reply":"2023-02-25T07:29:38.01355Z"},"papermill":{"duration":167.340553,"end_time":"2023-02-25T07:29:38.019317","exception":false,"start_time":"2023-02-25T07:26:50.678764","status":"completed"},"tags":[]},"outputs":[],"source":["# MovieLens 10M dataset:\n","# https://grouplens.org/datasets/movielens/10m/\n","# http://files.grouplens.org/datasets/movielens/ml-10m.zip\n","\n","ratings <- fread(text = gsub(\"::\", \"\\t\", \n","                 readLines(\"/kaggle/input/movielens-10m-dataset-latest-version/ml-10M100K/ratings.dat\")),\n","                 col.names = c(\"userId\", \"movieId\", \"rating\", \"timestamp\"))"]},{"cell_type":"code","execution_count":3,"id":"c9844017","metadata":{"execution":{"iopub.execute_input":"2023-02-25T07:29:38.089963Z","iopub.status.busy":"2023-02-25T07:29:38.08806Z","iopub.status.idle":"2023-02-25T07:29:38.110635Z","shell.execute_reply":"2023-02-25T07:29:38.108692Z"},"papermill":{"duration":0.060181,"end_time":"2023-02-25T07:29:38.113236","exception":false,"start_time":"2023-02-25T07:29:38.053055","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<style>\n",".list-inline {list-style: none; margin:0; padding: 0}\n",".list-inline>li {display: inline-block}\n",".list-inline>li:not(:last-child)::after {content: \"\\00b7\"; padding: 0 .5ex}\n","</style>\n","<ol class=list-inline><li>'data.table'</li><li>'data.frame'</li></ol>\n"],"text/latex":["\\begin{enumerate*}\n","\\item 'data.table'\n","\\item 'data.frame'\n","\\end{enumerate*}\n"],"text/markdown":["1. 'data.table'\n","2. 'data.frame'\n","\n","\n"],"text/plain":["[1] \"data.table\" \"data.frame\""]},"metadata":{},"output_type":"display_data"}],"source":["class(ratings)"]},{"cell_