2 Star Trek: Generations (1994)\n","  genres                       \n","1 Comedy|Romance               \n","2 Action|Crime|Thriller        \n","3 Comedy                       \n","4 Action|Drama|Sci-Fi|Thriller \n","5 Action|Adventure|Sci-Fi      \n","6 Action|Adventure|Drama|Sci-Fi"]},"metadata":{},"output_type":"display_data"}],"source":["head(movielens)"]},{"cell_type":"markdown","id":"4ecb56d2","metadata":{"papermill":{"duration":0.037549,"end_time":"2023-02-25T07:29:45.211888","exception":false,"start_time":"2023-02-25T07:29:45.174339","status":"completed"},"tags":[]},"source":["# Model evaluation"]},{"cell_type":"markdown","id":"70be4428","metadata":{"papermill":{"duration":0.035591,"end_time":"2023-02-25T07:29:45.282397","exception":false,"start_time":"2023-02-25T07:29:45.246806","status":"completed"},"tags":[]},"source":["## The validation set\n","- To evaluate the system’s effectiveness, a validation set is to be built using a small subset of the dataset at hand; it is upon this validation set that the RMSE will be computed. To split the movielens in a working set and the validation one the R built-in functions nrow() and sample() could be used to randomly select row indexes, dividing the dataset based on said indexes. This split is showcased in the following code snippet, where the validation set is built using 10% of the dataset’s indexes; the missing 90% is used to create the working_set object, which is the set to work upon and develop the model with.\n","Note that the validation set is referred to as temp at this point since it is missing key steps without which it can be hardly considered a valid validation set. Finally, the tibble() function (from the tibble package) is used to create a table-like structure to showcase the different sets’ length.\n"]},{"cell_type":"markdown","id":"3cdeeec7","metadata":{"papermill":{"duration":0.036664,"end_time":"2023-02-25T07:29:45.354833","exception":false,"start_time":"2023-02-25T07:29:45.318169","status":"completed"},"tags":[]},"source":["## Using built-in R functions to create the working and validation sets"]},{"cell_type":"code","execution_count":11,"id":"963e57ae","metadata":{"execution":{"iopub.execute_input":"2023-02-25T07:29:45.4349Z","iopub.status.busy":"2023-02-25T07:29:45.433099Z","iopub.status.idle":"2023-02-25T07:29:46.514409Z","shell.execute_reply":"2023-02-25T07:29:46.51245Z"},"papermill":{"duration":1.126474,"end_time":"2023-02-25T07:29:46.517842","exception":false,"start_time":"2023-02-25T07:29:45.391368","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["<table class=\"dataframe\">\n","<caption>A tibble: 3 × 2</caption>\n","<thead>\n","\t<tr><th scope=col>Dataset</th><th scope=col>Number of ratings</th></tr>\n","\t<tr><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th></tr>\n","</thead>\n","<tbody>\n","\t<tr><td>movielens  </td><td>10000054</td></tr>\n","\t<tr><td>working_set</td><td> 9000049</td></tr>\n","\t<tr><td>temp       </td><td> 1000005</td></tr>\n","</tbody>\n","</table>\n"],"text/latex":["A tibble: 3 × 2\n","\\begin{tabular}{ll}\n"," Dataset & Number of ratings\\\\\n"," <chr> & <int>\\\\\n","\\hline\n","\t movielens   & 10000054\\\\\n","\t working\\_set &  9000049\\\\\n","\t temp        &  1000005\\\\\n","\\end{tabular}\n"],"text/markdown":["\n","A tibble: 3 × 2\n","\n","| Dataset &lt;chr&gt; | Number of ratings &lt;int&gt; |\n","|---|---|\n","| movielens   | 10000054 |\n","| working_set |  9000049 |\n","| temp        |  1000005 |\n","\n"],"text/plain":["  Dataset     Number of ratings\n","1 movielens   10000054         \n","2 working_set  9000049         \n","3 temp         1000005         "]},"metadata":{},"output_type":"display_data"}],"source":["# set.seed(1, sample.kind=\"Rounding\") # if using R 3.5 or earlier, use `set.seed(1)`\n","set.seed(1)\n","validation_index <- sample(1:nrow(movielens), 0.1*nrow(movielens))\n","working_set <- movielens[-validation_index,]\n","temp <- movielens[validation_index,]\n","\n","tibble(Dataset = c(\"movielens\", \"working_set\", \"temp\"),\n","       \"Number of ratings\" = c(nrow(movielens), nrow(working_set), nrow(temp)))"]},{"cell_type":"markdown","id":"c0439763","metadata":{"papermill":{"duration":0.043221,"end_time":"2023-02-25T07:29:46.61128","exception":false,"start_time":"2023-02-25T07:29:46.568059","status":"completed"},"tags":[]},"source":["- Despite being perfectly valid, built-in R functions are not the usual/preferred approach for this sort of split. The caret package (short for Classification And Regression Training) contains a variety of tools to streamline many machine learning tasks (it is undoubtedly one of the most popular libraries for the matter) and among its many functions lies createDataPartition(), often used for the train-test split (which will be showcased later on) but equally ideal for the construction of the validation set. This function not only divides a given dataset based on a specified proportion but it does so while keeping the classification ratio constant within each set so that both have the same factor/cluster distribution as the original dataset, avoiding certain unfavorable scenarios where there might not be a sufficient amount of a given factor within the working set to allow the algorithm to develop a fitting model."]},{"cell_type":"code","execution_count":12,"id":"70caf9c2","metadata":{"execution":{"iopub.execute_input":"2023-02-25T07:29:46.701314Z","iopub.status.busy":"2023-02-25T07:29:46.699328Z","iopub.status.idle":"2023-02-25T07:29:46.717011Z","shell.execute_reply":"2023-02-25T07:29:46.714685Z"},"papermill":{"duration":0.073461,"end_time":"2023-02-25T07:29:46.721154","exception":false,"start_time":"2023-02-25T07:29:46.647693","status":"completed"},"tags":[]},"outputs":[],"source":["# # Do not run this code snippet, as it is only here for illustration purposes\n","# library(caret)\n","# createDataPartition(\n","#   y,\n","#   times = 1,\n","#   p = 0.5,\n","#   list = TRUE,\n","#   groups = min(5, 