up_by(movieId) %>%\n","    summarize(b_i = sum(rating - mu) / (n() + lambda))\n","\n","  b_u <- train_set %>% \n","    left_join(b_i, by=\"movieId\") %>%\n","    filter(!is.na(b_i)) %>%\n","    group_by(userId) %>%\n","    summarize(b_u = sum(rating - mu - b_i) / (n() + lambda))\n","\n","  predicted_ratings <- test_set %>% \n","    left_join(b_i, by = \"movieId\") %>%\n","    left_join(b_u, by = \"userId\") %>%\n","    filter(!is.na(b_i), !is.na(b_u)) %>%\n","    mutate(pred = mu + b_i + b_u) %>%\n","    pull(pred)\n","  \n","  return(Metrics::rmse(predicted_ratings, test_set$rating))\n","}"]},{"cell_type":"markdown","id":"dd668ac1","metadata":{"papermill":{"duration":0.05478,"end_time":"2023-02-25T07:34:17.274648","exception":false,"start_time":"2023-02-25T07:34:17.219868","status":"completed"},"tags":[]},"source":["## The regularization function at play\n","- Regularization refers to techniques that are used to calibrate machine learning models in order to minimize the adjusted loss function and prevent overfitting or underfitting. "]},{"cell_type":"code","execution_count":77,"id":"bd57c152","metadata":{"execution":{"iopub.execute_input":"2023-02-25T07:34:17.389244Z","iopub.status.busy":"2023-02-25T07:34:17.387451Z","iopub.status.idle":"2023-02-25T07:38:12.808991Z","shell.execute_reply":"2023-02-25T07:38:12.805552Z"},"papermill":{"duration":235.546268,"end_time":"2023-02-25T07:38:12.875524","exception":false,"start_time":"2023-02-25T07:34:17.329256","status":"completed"},"tags":[]},"outputs":[{"name":"stdout","output_type":"stream","text":["\u001b[90m# A tibble: 41 × 2\u001b[39m\n","   Lambda  RMSE\n","    \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m \u001b[3m\u001b[90m<dbl>\u001b[39m\u001b[23m\n","\u001b[90m 1\u001b[39m   0    0.866\n","\u001b[90m 2\u001b[39m   0.25 0.865\n","\u001b[90m 3\u001b[39m   0.5  0.865\n","\u001b[90m 4\u001b[39m   0.75 0.865\n","\u001b[90m 5\u001b[39m   1    0.865\n","\u001b[90m 6\u001b[39m   1.25 0.865\n","\u001b[90m 7\u001b[39m   1.5  